import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { Auth0Provider } from '@auth0/auth0-react';

import HomePage from './Components/HomePage.jsx';
import Classroom from './Components/Classroom.jsx';
import Create from './Components/Create.jsx';
import QuizGenerator from './Components/QuizGenerator.jsx';
import UnauthorizedPage from './Components/UnauthorizedPage.jsx';

const App = () => {
  return (
    <Auth0Provider
      domain="dev-147umiv5h85hvjw1.us.auth0.com"
      clientId="FH2Q3oyoJZfKm1NbPBrWhH4PGs5BlnlE"
      authorizationParams={{
        redirect_uri: window.location.origin
      }}
    >
      <Router>
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/generate" element={<QuizGenerator />} />
          <Route path="/Classroom" element={<Classroom />} />
          <Route path="/Create" element={<Create />} />
          <Route path="/Home" element={<HomePage />} />
          <Route path="*" element={<UnauthorizedPage />} />
        </Routes>
      </Router>
    </Auth0Provider>
  );
};

export default App;
